//@ts-nocheck
import Grid from '@material-ui/core/Grid';
import Paper from '@material-ui/core/Paper';
import React from 'react';
import {StyleSheet, Text} from 'react-native';


const styles = {

  ContentStyles:{

  },
  paper: {
    listStyles:'none',
    fontSize:'50px'
  }
}

type priceCardprops={
  children?: React.ReactNode
  buttonText?:string
  servicesData?:any
  cardData?: any
  planNameStylesStyles?:any
  amountStyles?:any
  buttonStyles?:any
  listStyles?:any
}

export const PriceCardDisplayV = (props:priceCardprops) => {

  const _getServices=()=>{
    const _data:any=[];

      // eslint-disable-next-line no-unused-expressions
    Array.isArray(props?.servicesData) && props?.servicesData.forEach(item=>{
      _data.push(
        <ul style={StyleSheet.flatten([styles.ContentStyles, props?.listStyles])}>
          <li >{item.name}</li>
        </ul>
      )
    });
    return _data;
  }

  const _getPriceCards = () => {

    const _tempData:any = [];
  // eslint-disable-next-line no-unused-expressions
    Array.isArray(props?.cardData) && props?.cardData.forEach(item=>{
      _tempData.push(
        <Grid item xs={12} sm={6} md={3} >
          <Paper  style={{backgroundColor:item.bg,textAlign:'center',}} >
          <Text style={StyleSheet.flatten([styles.ContentStyles, props?.planNameStylesStyles])}>{item?.planName}</Text>
            <hr/>
             {_getServices()}
            <Text style={StyleSheet.flatten([styles.ContentStyles, props?.amountStyles])}>{item.amount}</Text>
      <button style={StyleSheet.flatten([styles.ContentStyles, props?.buttonStyles])}>{props?.buttonText}</button>
           </Paper>
        </Grid>
      )
    });
    return _tempData;
  }

  return(
    <Grid container justify={"center"} alignItems={"center"} >
      <Grid item xs={11}>
      <Grid container justify={"center"} alignItems={"center"} spacing={4} >
      {_getPriceCards()}
      </Grid>
      </Grid>
    </Grid>
  )
}
